import React from "react";
import TaskItem from "./TaskItem";

const TaskList = ({ list }) => {
  return (
    <div>
      <h3>{list.title}</h3>
      {list.tasks.map((task) => (
        <TaskItem key={task.id} task={task} />
      ))}
    </div>
  );
};

export default TaskList;
